function animateWidthChange(elem) {
  var w1 = elem.scrollWidth,
      w2 = $(elem).innerWidth(),
      w3;
  $(elem).css({
    "width": w2,
    "overflow": "hidden"
  });
  var wait = setInterval(function () {
    w3 = elem.scrollWidth;
    console.log(w1 + " " + w2 + " " + w3);

    if (w3 != w1) {
      clearInterval(wait);
      $(elem).animate({
        "width": w3
      }, 800, function () {
        $(elem).css({
          "width": "auto",
          "oveflow": "auto"
        });
      });
    }
  }, 100);
  console.log('finish');
}

