function resizeFcCalendar(view) {
  $(".fc-toolbar").each(function () {
    var toolbar = $(this),
        fullCal = toolbar.closest('.fc'),
        w = toolbar.width(),
        em = getEm(),
        realWidth = toolbar[0].scrollWidth,
        wLeft = toolbar.find('.fc-left')[0].scrollWidth,
        wCenter = toolbar.find('.fc-center')[0].scrollWidth,
        wRight = toolbar.find('.fc-right')[0].scrollWidth,
        wTotal = wLeft + wCenter + wRight,
        changed = false;

    if (toolbar.find('.fc-center').html() == "") {
      toolbar.find('.fc-center').css({
        padding: "0 1em"
      });
    }

    while (realWidth - w > 1) {
      fullCal.css({
        fontSize: "-=0.05em"
      });
      w = toolbar.width();
      realWidth = toolbar[0].scrollWidth;
      changed = true;
    }

    while (wTotal + 3 * em < w && em > getEm(fullCal)) {
      fullCal.css({
        fontSize: "+=0.05em"
      });
      w = toolbar.width();
      wLeft = toolbar.find('.fc-left').width();
      wCenter = toolbar.find('.fc-center').width();
      wRight = toolbar.find('.fc-right').width();
      wTotal = wLeft + wCenter + wRight;
      changed = true;
    }

    if (changed) {
      calendar.updateSize();
    }
  });
}

