function getEm() {
  var ele = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : null;

  if (ele == null) {
    ele = $("body");
  }

  return Number(ele.css('font-size').split("px")[0]);
}

var menuWidth;

function resizeImageClicks() {
  $('.imageClick').each(function () {
    var height = $(this).data('height') != 'null' ? $(this).data('height') : '20em',
        ratio = $(this).data('ratio') != 'null' ? Number($(this).data('ratio')) : 1.5,
        width,
        parentRect = $(this).parent()[0].getBoundingClientRect(),
        parentWidth = parentRect.width,
        newWidth,
        newHeight,
        visible = $(this).is(":visible");
    $(this).css({
      height: height
    });
    var img = $(this);
    setTimeout(function () {
      var heightInPx = img.outerHeight(),
          newHeight;
      width = heightInPx * ratio;
      newWidth = width; // console.log(img,height);

      img.css({
        width: width
      }); // console.log(img.css('width'));

      if (visible) {
        while (newWidth > parentWidth) {
          newWidth = newWidth * 0.95;
        }

        if (newWidth != width) {
          newHeight = newWidth / ratio;
          img.css({
            width: newWidth,
            height: newHeight
          });
        }
      }
    }, 501);
  });
}

function resizeMobileMenuAndFooter() {
  var siteMenu = $(".siteMenu").first();
  var tabs = siteMenu.add("#MenuDisplay").children(".tab").not("#Notifications, #mobilePlaceholder, #MobileMenu"),
      hasPlaceholder = $("#mobilePlaceholder").length == 1;

  if (!siteMenu.hasClass("mobile")) {
    menuWidth = siteMenu.outerWidth();
  }

  var logo = $("#NavBar").find('.logo'),
      logoW = logo[0].scrollWidth,
      menuW = siteMenu[0].scrollWidth,
      em;
  em = getEm();
  var w = $("body").width();
  var tooWide = logoW + menuW + 6 * em > w,
      wideEnough = null;

  if (siteMenu.data('width') != undefined) {
    wideEnough = logoW + siteMenu.data('width') + 6 * em < w;
  } // if (p > 0.6){


  if (tooWide) {
    siteMenu.data('width', menuW);
    siteMenu.addClass("mobile");

    if (hasPlaceholder) {
      $("#mobilePlaceholder").replaceWith(tabs);
    } else {
      tabs.appendTo("#MenuDisplay");
    }
  } else if (wideEnough) {
    siteMenu.removeClass("mobile");
    tabs.appendTo(siteMenu);
    siteMenu.find(".dropDown").removeClass("active");
    siteMenu.removeData('width');
  }

  moveNotifications();

  if (w < 480) {
    $("footer").find(".logo, .icons, .contact, .hours").addClass("mobile");
  } else if (w < 750) {
    $("footer").find(".logo, .icons").addClass("mobile");
    $("footer").find(".contact, .hours").removeClass("mobile");
  } else {
    $("footer").find(".logo, .icons, .contact, .hours").removeClass("mobile");
  }
}

function moveNotifications() {
  var siteMenu = $(".siteMenu").first(),
      mobileNow = siteMenu.hasClass('mobile');

  if (mobileNow) {
    $("#Notifications").prependTo(siteMenu);
  } else {
    $("#Notifications").insertBefore(siteMenu.find(".divide"));
  }
}

